The Imps are 10.000 randomly generated, animated, 3D characters on the Ethereum blockchain. Each one is completely unique but some are more rare than others. Each trait is handcrafted by SuperNfty in his signature floaty style.

Check out the [Spirits](https://opensea.io/collection/spirits-by-supernfty), the [Genesis collection](https://opensea.io/collection/super-nfty-floating-heads), the [Superballs](https://opensea.io/collection/superballsnft), the [Rarity page](https://rarity.tools/imps-by-supernfty) and read more about SuperNfty on [Supernfty.com](https://www.supernfty.com/). Join the [Discord](https://discord.gg/supernfty), talk to other collectors and join the owners-exclusive chatrooms:
@SuperNfty On [Twitter](https://twitter.com/SuperNfty) and [Instagram](https://www.instagram.com/supernfty/)

Genuine history locked in NFTs.

Set In Merge — the first and last NFT collection that is minted both in Ethereum's PoS and PoW parts of blockchain. Dedicated to The Merge, it captures and absorbs the historical moment of the great event, turning it into its inner value. 

The value of NFT depends on its proximity to the first PoS block or to the last PoW block depending when an NFT was minted. The number in the top right corner shows this proximity. Proximity number is not presented on the POAPs. The NFT tier is defined by the proximity.

Examples:
SIM 1 PoW - NFT was minted in the last block of PoW chain; 
SIM 1 PoS - NFT was minted in the first block of PoS chain; 
SIM 5 PoW - NFT was minted in the last fifth block of PoW chain; 
SIM 5  PoS - NFT was minted in the first block of PoS chain; 
SIM POAP PoW - NFT was minted > 300 blocks before The Merge; 
SIM POAP PoS - NFT was minted > 300 blocks after The Merge;
